import React, { Component } from 'react';
import {link} from 'react-router-dom'

export default class Home extends Component {

  render() {

    return (
      <React.Fragment>
        <h1>Home</h1>
        <link to='//login'>
        <button>LogIn</button>
        </link>
        <link>
        <button>SignUp</button>
        </link>
      </React.Fragment>
    );
  }
}
